//for mouse movement
const hoverArea = document.querySelector('.phase2glow');
const glow = document.getElementById('glow');

hoverArea.addEventListener('mousemove', function (e) {
    const rect = hoverArea.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;

    glow.style.left = `${x - glow.clientWidth / 2}px`;
    glow.style.top = `${y - glow.clientHeight / 2}px`;
    glow.style.opacity = 1; // Make the glow visible
});

hoverArea.addEventListener('mouseleave', function () {
    glow.style.opacity = 0; // Hide the glow when not hovering
});

