//dashboard button hover

const hoverdiv = document.querySelector(".hoverdiv");
const phase2btn = document.querySelectorAll(".phase2btn");
const phase2visicon = document.querySelector(".phase2visicon");
const condisc = document.querySelectorAll(".condisc");
const sccondisc = document.querySelector(".sccondisc");

for (let i = 0; i < phase2btn.length; i++) {
    phase2btn[i].addEventListener("click", () => {
        if (i === 0) {
            hoverdiv.style.transform = "translateX(0px)";
            phase2visicon.style.transform = "translateX(0px)";
            sccondisc.style.transform = "translateX(0px)";


        }
        else if (i === 1) {
            hoverdiv.style.transform = "translateX(74px)";
            phase2visicon.style.transform = "translateX(-1005px)";
            sccondisc.style.transform = "translateX(-982px)";

        }
        else if (i === 2) {
            hoverdiv.style.transform = "translateX(147px)";
            phase2visicon.style.transform = "translateX(-1970px)";
            sccondisc.style.transform = "translateX(-1964px)";

        }
        else {
            hoverdiv.style.transform = "translateX(0px)";
            sccondisc.style.transform = "translateX(0px)";

        }
    })
}




