function bubbleonhover(country, year, avg) {
    for (let i = 1; i <= 256; i++) { // Loop from 1 to 256
        const idc = document.querySelector(`#c${i}`); // Select SVG element


        // idc.style.fill = "#d8d8d8";
        if (idc) { // Ensure the element exists
            let bdiv;

            // Declare the bubble variable here


            idc.addEventListener("mouseover", (event) => {


                // idc.style.fill = "#ff9155";
                // idc.style.transition = "0.5s all ease";

                // Create the bubble
                bdiv = document.createElement("div");
                bdiv.className = "bubble";
                const innerbubble = document.createElement("div");
                innerbubble.className = "innerbubble";
                bdiv.appendChild(innerbubble);
                const bubbleconname = document.createElement("p");
                bubbleconname.className = "bubbleconname";
                innerbubble.appendChild(bubbleconname);
                bubbleconname.innerHTML = country;
                const bubbleconyear = document.createElement("p");
                bubbleconyear.className = "bubbleconyear";
                innerbubble.appendChild(bubbleconyear);
                bubbleconyear.innerHTML = year;
                const percentext = document.createElement("p");
                percentext.className = "percentext";
                bdiv.appendChild(percentext);
                percentext.innerHTML = "% of total labour force";
                const percentvalue = document.createElement("p");
                percentvalue.className = "percentvalue";
                bdiv.appendChild(percentvalue);
                percentvalue.innerHTML = avg;



                // Position the bubble (near the mouse pointer)
                bdiv.style.position = "absolute";
                bdiv.style.left = `${event.pageX}px`; // Mouse X position
                bdiv.style.top = `${event.pageY}px`;  // Mouse Y position

                // Append bubble to the body
                document.body.appendChild(bdiv);

            });

            idc.addEventListener("mousemove", (event) => {
                if (bdiv) {
                    // Update the position of the bubble as the mouse moves
                    bdiv.style.left = `${event.pageX}px`;
                    bdiv.style.top = `${event.pageY}px`;
                }
            });

            idc.addEventListener("mouseout", () => {
                // idc.style.fill = "#d8d8d8";
                // idc.style.transition = "0.5s all ease";

                // Remove the bubble
                if (bdiv) {
                    bdiv.remove();
                    bdiv = null; // Reset bubble reference
                }
            });



        }

    }
}




