//download button for map picture

document.getElementById('downloadBtnmap').addEventListener('click', function () {
    const imageUrl = "https://i.postimg.cc/9F0nD5QM/Screenshot-2024-12-24-143317.png";

    fetch(imageUrl)
        .then(response => response.blob())
        .then(blob => {
            const blobUrl = URL.createObjectURL(blob);
            const anchor = document.createElement('a');
            anchor.href = blobUrl;
            anchor.setAttribute('download', 'downloaded-map-image.jpg');
            document.body.appendChild(anchor);
            anchor.click();
            document.body.removeChild(anchor);
            URL.revokeObjectURL(blobUrl); // Clean up the blob URL
        })
        .catch(err => console.error('Error downloading the image:', err));
});

